drop table if exists t_goodsinfo;
create table t_goodsinfo(
	goods_id varchar(50) primary key comment '商品主键，用UUID设置',
	goods_name varchar(200) not null default '' comment '商品名',
	goods_info varchar(200) not null default '' comment '商品简介',
	goods_cat int not null comment '商品的分类ID',
	goods_key int not null comment '商品的关键字ID',
	goods_oriprice double(10,2) not null default 0 comment '商品的原价',
	goods_curprice double(10,2) not null default 0 comment '商品的现价',
	goods_ttnum int not null default 0 comment '商品的库存',
	goods_soldnum int not null default 0 comment '商品已售件数',
	goods_commentnum int not null default 0 comment '商品评价次数',
	goods_clicknum int not null default 0 comment '商品点击次数',
	goods_img text not null comment '商品预览图，最多五张',
	goods_isdeleted int not null default 0 comment '商品是否被删除，0表示未被删除，1表示已删除',
	goods_isonsite int not null default 0 comment '商品是否上架，0表示未被上架，1表示已上架',
	goods_createtime varchar(50) not null default '' comment '商品生成时间'
);
















































































































